// XXX anui.AuditRecord
type auditTestCase struct {
	Ok      bool
	Prior   anansi.ScreenState
	Virtual anansi.ScreenState
	Update  string
	Audit   anansi.ScreenState
}

func TestScreen_audit_cases(t *testing.T) {
	for i, dat := range auditTestCaseData {
		t.Run(fmt.Sprint(i), func(t *testing.T) {
			var tc auditTestCase
			require.NoError(t, json.NewDecoder(bytes.NewBufferString(dat)).Decode(&tc))

			require.Equal(t, tc.Virtual.Rect, tc.Audit.Rect, "must have same grid rect")
			require.False(t, tc.Virtual.Eq(tc.Audit.Grid, ' '), "grids must be unequal")

			sz := tc.Prior.Bounds().Size()

			var term anansi.Screen
			term.Resize(sz)

			var virt anansi.Screen
			virt.Resize(sz)
			virt.Real.Resize(sz)
			copy(virt.Real.Grid.Rune, tc.Prior.Grid.Rune)
			copy(virt.Real.Grid.Attr, tc.Prior.Grid.Attr)

			var updateBuf bytes.Buffer
			updateBuf.Grow(2 * len(tc.Update))

			virt.WriteTo(io.MultiWriter(&term, &updateBuf))

			if term.Eq(virt.Grid, ' ') {
				t.Logf("worked?")
				return
			}

			if update := updateBuf.String(); update != tc.Update {
				t.Logf("got update: %q", update)
				t.Logf("expected update: %q", tc.Update)
				t.FailNow()
			}

			aRunes, aAttrs := anansitest.GridRowData(tc.Virtual.Grid)
			bRunes, bAttrs := anansitest.GridRowData(tc.Audit.Grid)
			aLines := anansitest.RunesToLines(aRunes, ' ')
			bLines := anansitest.RunesToLines(bRunes, ' ')
			aCtls := anansitest.AttrsToCtls(aAttrs)
			bCtls := anansitest.AttrsToCtls(bAttrs)

			assert.Equal(t, aLines, bLines, "rune diff")
			assert.Equal(t, aCtls, bCtls, "attr diff")

		})
	}
}
